INSERT INTO `inspect_inform` VALUES ('1', '44641149', '186', '5', '举报1', '被举报人', '举报 : 7月15日，中央政法委秘书长、全国扫黑办主任陈一新主持召开全国扫黑办第七次主任会议，听取扫黑办主任、副主任分别带队的调研组“蹲一省联一片”的调研情况汇报，谋划下半年扫黑除恶任务和举措。他强调，要深入贯彻落实以习近平同志为核心的党中央决策部署，把握扫黑除恶阶段性新形势新任务，坚持以“破案攻坚”开路、以“打伞破网”断根、以“打财断血”绝后、以“问题整改”提质，推动下半年“深挖根治”取得更大成效。', '/images/inspect/small/inform/16262334/16262334-image1.jpg,/images/inspect/small/inform/16262334/16262334-image2.png', '/images/inspect/inform/47368541/47368541-image1.jpg,/images/inspect/inform/47368541/47368541-image2.png,/images/inspect/inform/47368541/47368541-image3.png,\r\n/images/inspect/inform/47368541/47368541-image4.jpg,/images/inspect/inform/47368541/47368541-image5.png,/images/inspect/inform/47368541/47368541-image6.png,\r\n/images/inspect/inform/47368541/47368541-image7.jpg,/images/inspect/inform/47368541/47368541-image8.png,/images/inspect/inform/47368541/47368541-image9.png', '127.0.0.1', '1', '2', '1562942196', '1');
