INSERT INTO `law_library` VALUES ('2', '2', '法务学习2', '法务对企业来说就是安全保卫系统，能给企业提供健康发展的帮助、规避各种法律风险。但长期以来，企业普遍不重视法务队伍建设，难以应对复杂多变的市场环境，阻碍了企业的发展，甚至遭遇到“灭顶之灾”。尤其是大公司是更需要一个公司法务的，大公司需要什么样的法务，找律师咨询。\n\n与律师相比，公司法务的工作相对没有那么高负荷，工作也比较有计划性，只不过作为一个支持部门，要做到让所有部门都满意也是一个不小的挑战。尽管看上去是一个在条条框框内做事的岗位，但做法务也同样需要用创意的思维去思考商业实践的问题。说服能力和感染力非常重要，只有这样，你才能在谈判中为公司争取到更多的利益。此外，法务工作有一个最新趋势，那就是从一个商业创意开始法务就需要介入，之后服务于商业过程中的每个环节。这意味着法务需要熟悉公司的所有业务，也就是有更多日常文案工作要做。这些工作很枯燥，但你还是要做到足够严谨', '0', '1', '1562921981');
INSERT INTO `law_library` VALUES ('3', '2', '法务学习3', '1、口头订立的合同能不能作数？\r\n\r\n能。但要注意保留证据，避免纠纷时无法证明口头合同的存在。《合同法》第10条规定，当事人订立合同，有书面形式、口头形式和其他形式。法律、行政法规规定采用书面形式的，应当采用书面形式。当事人约定采用书面形式的，应当采用书面形式。', '0', '1', '1562921982');
INSERT INTO `law_library` VALUES ('4', '2', '法务学习4', '2、通过电子邮件商量好的内容能否算做合同的一部分？\r\n\r\n能。《合同法》第11条规定，书面形式是指合同书、信件和数据电文(包括电报、电传、传真、电子数据交换和电子邮件)等可以有形地表现所载内容的形式。', '0', '1', '1562921983');
INSERT INTO `law_library` VALUES ('5', '1', '法务学习5', '3、合同没有约定的事项怎么处理？\r\n\r\n《合同法》第61条规定，合同生效后，当事人就质量、价款或者报酬、履行地点等内容没有约定或者约定不明确的，可以协议补充;不能达成补充协议的，按照合同有关条款或者交易习惯确定。', '0', '1', '1562921984');
